import React, {Component} from 'react'; 
import {Table} from '../Components/Table'

class Distribution extends Component{

  constructor () {
    super();
    this.name = "Undefined";
  }

  calcularMedia = () =>{
    return 5;
  }

  render(){

    return(
      <div> 
      {this.name} 
      <Table _media={this.calcularMedia} _varianza={2}/>
      </div>
    )
  }

}

export default Distribution;
